"""# Questão 02:

Considere a seguinte função de transferência:

$ G(s)= \frac{1}{s^2 + 0.8s + 1}$

Utilizando a linguagem de programação Python calcular o pico de ressonância em $dB$ e freqüência em que ocorre o pico de ressonância em $\frac{rad}{s}$.

**Resolução Questão 2**
"""

## Declarando a função de transferêmcoa dada

num = [1]
den = [1, 0.8, 1]
sistema = tf(num,den)

n=3000

#Declaração de uma array com n elementos

mod = np.zeros(n)
w = np.logspace(-2,2,n)

## Utilizando a função nyquist para obter os vetores que possuem as partes reais, complexas e a frequencia para cada
## Valor do vetor w

real, imag, freq = nyquist(sistema,w, Plot=False)

i =0;
## Variáveis que guardam o valor do maior módulo e seu índice

maior_mod = -500
maior_mod_indice = 0;

while i<n:
  mod[i] = np.sqrt(real[i]**2+imag[i]**2)
  if(mod[i]>maior_mod):
    maior_mod = mod[i]
    maior_mod_indice = i
  i = i + 1


## transformando o módulo do pico de ressonância em dB

maior_mod_db = 20*np.log10(maior_mod)

# Obtendo o valor da freqência do pico de ressonância
freq_ress=freq[maior_mod_indice]

print("O valor dp pico de Ressonância e ", maior_mod_db, "dB e a frequência é ", freq_ress," rad/s")

